import React from 'react';
import ProfileCompany from "./profileCompany";
import {connect} from "react-redux";
import {updateTextComment} from "../../../../redux/profileTransportCompanyReducer";

class ProfileCompanyContainer extends React.Component{

    render() {
            return<ProfileCompany {...this.props}/>
    }
}
let mapStateToProps=(state)=>{
    return{
        ProfileCompany:state.ProfileCompanyPage
    }
}
let ExportProfileTransportCompany = connect(mapStateToProps,{updateTextComment})(ProfileCompanyContainer);
export default ExportProfileTransportCompany;
